import React from "react";

const Header = () => {
  return (
    <div className="container">
      <nav class="nav nav-pills nav-justified">
        <a class="nav-item nav-link " href="#">
          Active
        </a>
        <a class="nav-item nav-link" href="#">
          Link
        </a>
        <a class="nav-item nav-link" href="#">
          Link
        </a>
        <a class="nav-item nav-link " href="#">
          Disabled
        </a>
      </nav>
    </div>
  );
};

export default Header;
